    def move(self,move,gravity):
        #gravity = 1: normal  #gravity = -1:  upside-down
        if(gravity == 1 or gravity == -1):
            self.oldpos = self.pos[:]
            self.pos[0] = self.pos[0] + move[0] * gravity
            self.pos[1] = self.pos[1] + move[1] * gravity
