    def rotate(self,gravity,figureshape ='cube'):
        if(figureshape == 'cube' or figureshape == 'ball'):
            if(gravity == 1):
                self.angle = self.angle - 4.5
            elif(gravity != 1):
                self.angle = self.angle + 4.5
            else:
                self.angle = 360
        elif(figureshape == 'arrow'):
            if(self.angle > 0):
                self.angle = 360
            elif(self.angle == 360):
                self.angle = 90
            else:
                self.angle = 360

