        while self.NotInGame:
            #handling all these problematic events!
            for event in pygame.event.get():
                #DO WE WANT TO QUIT???
                if event.type == pygame.QUIT:
                    pygame.quit()
                #have we moved the mouse
                if event.type == pygame.MOUSEMOTION:
                    #update the mouse's position
                    self.mousepos = event.pos
                if event.type == pygame.MOUSEBUTTONDOWN:
                    #have we clicked on a level?
                    if(self.mousepos[0] > 30 and self.mousepos[0] < 170):
                        if(self.mousepos[1] > 20 and self.mousepos[1] < 100):
                            self.NotInGame = False
                    #have we clicked left/right?
                    if(self.mousepos[1] > 50 and self.mousepos[1] < 70):
                        if(self.mousepos[0] > 170 and self.mousepos[0] < 200):
                            self.direction = 'right'
                        elif(self.mousepos[0] > 0 and self.mousepos[0] < 30):
                            self.direction = 'left'
                    #have we clicked that "back" button?
                    if(self.get_collision(self.mousepos,self.backbutton)):
                        return "EX    IT"

            #handling some event variables
            #do we need to scroll left?
            if(self.direction == 'left'):
                self.oldpos = self.position
                if(self.position > 0):
                    self.position -= 1
                else:
                    self.position = len(self.compliment) - 1
            #do we need to scroll right?
            elif(self.direction == 'right'):
                self.oldpos = self.position
                if(self.position < len(self.compliment) - 1):
                    self.position += 1
                else:
                    self.position = 0

            #do we need to scroll a little??
            if(self.position != self.oldpos):
                for e in range(0,50):
                    if(self.direction == 'left'):
                        x = 50 - e
                    else:
                        x = e
                    screen.fill([0,0,0])
                    self.Draw('square',[[255,0,0],[30 - x * 4,20,140,80]])
                    self.Draw('square',[[255,0,0],[30 + (50 - x) * 4,20,140,80]])
                    self.Draw('polygon',[[255,255,0],[[180,50],[180,70],[198,60]]])
                    self.Draw('polygon',[[255,255,0],[[2,60],[20,50],[20,70]]])
                    if(self.direction == 'left'):
                        self.offset = e * 4
                        self.incomingoffset = -200 + e * 4
                    else:
                        self.offset = -e * 4
                        self.incomingoffset = 200 - (e * 4)
                    self.needtoblit = self.Draw('text',[self.compliment[self.position],[255,255,255],10])
                    screen.blit(self.needtoblit,[(100 - len(list(self.compliment[self.position])) * 10 / 2) + self.incomingoffset, 40])
                    self.needtoblit = self.Draw('text',[self.compliment[self.oldpos],[255,255,255],10])
                    screen.blit(self.needtoblit,[(100 - len(list(self.compliment[self.oldpos])) * 10 / 2) + self.offset, 40])
                    pygame.display.flip()
                    self.clock.tick(60)
                self.direction = ' '
                self.oldpos = self.position

            #what if we can be complacent and sit where we are?
            if(self.position == self.oldpos):
                screen.fill([0,0,0])
                self.Draw('square',[[255,0,0],[30,20,140,80]])
                self.needtoblit = self.Draw('text',[self.compliment[self.position],[255,255,255],10])
                screen.blit(self.needtoblit,[100 - len(list(self.compliment[self.position])) * 10 / 2, 40])
                self.Draw('polygon',[[255,255,0],[[180,50],[180,70],[198,60]]])
