    def GameMenu(self,PMStatus = False,PMPos = [[0,0],[0,0],[0,0]]):
        #note: PMStatus stands for Practice Mode status (Is it True - Practice mode on, or False?)
        global screen
        InMenu = True
        while InMenu:
            #event loop
            for event in pygame.event.get():
                #do we want to LEAVE???
                if(event.type == pygame.QUIT):
                    pygame.quit()

                #were TRACKING your mouse movements!
                elif(event.type == pygame.MOUSEMOTION):
                    self.mousepos = event.pos

                #are we clicking on things???
                elif(event.type == pygame.MOUSEBUTTONDOWN):
                    #have we clicked resume?
                    if(self.mousepos[0] > 90 and self.mousepos[0] < 110):
                        if(self.mousepos[1] > 50 and self.mousepos[1] < 70):
                            self.out = "resume"
                            InMenu = False

                    #have we clicked "return to level menu"
                    if(self.mousepos[0] > 50 and self.mousepos[0] < 60):
                        if(self.mousepos[1] > 55 and self.mousepos[1] < 65):
                            self.out = "level menu"
                            InMenu = False

                    #did we click "practice mode"?
                    if(self.mousepos[0] > 140 and self.mousepos[0] < 150):
                        if(self.mousepos[1] > 50 and self.mousepos[1] < 70):
                            self.out = "practice mode"
                            InMenu = False
                    
            #fill our screen with black
            screen.fill([0,0,0])

